// frontend/src/components/TimetableEditor.js
import React, { useState, useEffect } from 'react';

const STATIONS = [
  { name: "MUMBAI CST", pos_km: 0.0 },
  { name: "THANE", pos_km: 41.9 },
  { name: "KALYAN", pos_km: 85.5 },
  { name: "KARJAT", pos_km: 118.7 },
  { name: "LONAVALA", pos_km: 150.1 },
  { name: "PUNE", pos_km: 192.0 }
];

const TimetableEditor = () => {
  const [schedules, setSchedules] = useState([]);
  const [form, setForm] = useState({
    id: '', name: '', type: 'EXPRESS', priority: 1, speed: 80, departure_time_seconds: 0,
    start_station: STATIONS[0].name, end_station: STATIONS[STATIONS.length - 1].name
  });

  const fetchSchedules = () => {
    fetch('http://127.0.0.1:5001/api/schedules')
      .then(res => res.json())
      .then(data => setSchedules(data))
      .catch(err => console.error(err));
  };

  useEffect(() => { fetchSchedules(); }, []);

  const handleAdd = (e) => {
    e.preventDefault();
    // basic validation
    if (!form.id || !form.name) { alert('Provide id and name'); return; }
    fetch('http://127.0.0.1:5001/api/add_schedule', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(form)
    })
    .then(res => res.json())
    .then(data => {
      if (data.success) {
        fetchSchedules();
        setForm({
          id: '', name: '', type: 'EXPRESS', priority: 1, speed: 80, departure_time_seconds: 0,
          start_station: STATIONS[0].name, end_station: STATIONS[STATIONS.length - 1].name
        });
      } else alert(data.message || 'Error');
    })
    .catch(err => console.error(err));
  };

  const handleDelete = (id) => {
    fetch(`http://127.0.0.1:5001/api/delete_schedule/${id}`, { method: 'DELETE' })
      .then(res => res.json())
      .then(() => fetchSchedules())
      .catch(err => console.error(err));
  };

  return (
    <div className="timetable-editor">
      <h3>Timetable Editor</h3>
      <form onSubmit={handleAdd} className="timetable-form">
        <input placeholder="Train ID" value={form.id} onChange={e => setForm({...form, id: e.target.value})} />
        <input placeholder="Train Name" value={form.name} onChange={e => setForm({...form, name: e.target.value})} />
        <select value={form.type} onChange={e => setForm({...form, type: e.target.value})}>
          <option value="EXPRESS">EXPRESS</option>
          <option value="GOODS">GOODS</option>
          <option value="LOCAL">LOCAL</option>
        </select>
        <input type="number" placeholder="Priority" value={form.priority} onChange={e => setForm({...form, priority: parseInt(e.target.value||0)})} />
        <input type="number" placeholder="Speed (km/h)" value={form.speed} onChange={e => setForm({...form, speed: parseInt(e.target.value||0)})} />
        <input type="number" placeholder="Departure time (sec)" value={form.departure_time_seconds} onChange={e => setForm({...form, departure_time_seconds: parseInt(e.target.value||0)})} />

        <label>Start Station:
          <select value={form.start_station} onChange={e => setForm({...form, start_station: e.target.value})}>
            {STATIONS.map(s => <option key={s.name} value={s.name}>{s.name}</option>)}
          </select>
        </label>

        <label>End Station:
          <select value={form.end_station} onChange={e => setForm({...form, end_station: e.target.value})}>
            {STATIONS.map(s => <option key={s.name} value={s.name}>{s.name}</option>)}
          </select>
        </label>

        <button type="submit">Add / Update</button>
      </form>

      <h4>Existing schedules</h4>
      <ul className="schedule-list">
        {schedules.map(s => (
          <li key={s.id}>
            <strong>{s.id}</strong> — {s.name} | {s.type} | dep:{s.departure_time_seconds}s | start:{s.start_station || 'MUMBAI CST'} → end:{s.end_station || 'PUNE'}
            <button onClick={() => handleDelete(s.id)}>Delete</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default TimetableEditor;
